import { connect } from 'react-redux';
import { withRouter, Route } from 'react-router-dom';

import Step1 from './Step1/Step1';

function Quote(props) {
  console.log('checking props', props.match.path);


  return (
    <div className='quote'>
      <button onClick={() => props.history.push(`${props.match.path}/step1`)}>Start Quote</button>

      <Route exact path={`${props.match.path}/step1`} component={Step1} />
      <Route exact path={`${props.match.path}/step2`} component={Step2} />
      <Route exact path={`${props.match.path}/step3`} component={Step3} />
      <Route exact path={`${props.match.path}/step4`} component={Step4} />
      <Route exact path={`${props.match.path}/step5`} component={Step5} />
      <Route exact path={`${props.match.path}/step6`} component={Step6} />
      <Route exact path={`${props.match.path}/step7`} component={Step7} />
      <Route exact path={`${props.match.path}/step8`} component={Step8} />
      <Route exact path={`${props.match.path}/step9`} component={Step9} />
      <Route exact path={`${props.match.path}/step10`} component={Step10} />

    </div>

  );
}

export default connect()(withRouter(Quote));
